VALUES ('3564700000120', 'Couscous Royal', '2 sachets de garniture (650 g) : légumes 33% (carottes, navets, courgettes, poivrons rouges et verts. _céleri_, pois chiches cuits 1,5%), eau, pilon de poulet* cuit avec peau 16%, merguez cuite 10% (viande de bœuf*, eau, gras de bœuf, viande de mouton*, gras de mouton, sel, dextrose, épices, arômes naturels, colorant : extrait de paprika, antioxydant : E316. boyau de mouton), boulette à base de viande bovine cuite 6,1% (viande de bœuf*, blanc d‘_œuf_, chapelure (farine de _blé_, sel), oignon, sel, épices et aromates, huile de tournesol), arôme naturel, double concentré de tomates, épices et aromates (dont _moutarde_). (% exprimés sur les sachets de garniture).  2 sachets de semoule cuisinée (350 g) : eau, semoule de _blé_ dur, huile de tournesol, arôme naturel (dont _lactose_), sel.  2 sachets d\'épices et aromate : piment doux, poivre noir, carvi, ail, coriandre. * Origine : UE', 'https://static.openfoodfacts.org/images/products/356/470/000/0120/front_fr.3.400.jpg', '4.4', '1.5', '14.8', '2.6', '1.8', '6.4', '0.528', '0.207874015748031', '', '1');

