INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700009925', 'Cassoulet Saucisses & saucisson fumés', 'Eau, haricots blancs réhydratés 33% (dont affermissant : chlorure de calcium), saucisses pur porc fumées et rondelles de saucisson pur porc fumé 13,3% (viande de porc, maigre de tête de porc, eau, gras et couenne de porc, plasma de porc, sel, amidon de pois, stabilisant : E451, arômes naturels, protéines de _lait_, gélifiants : gomme guar, gomme xanthane, carraghénanes, coriandre en poudre, sirop de glucose, conservateur : E250), viande de porc traité en salaison précuite 9% (viande de porc, eau, sel, stabilisant : E451, gélifiant : E407a, conservateur : E250), concentré de tomates, saindoux, amidon modifié de maïs, sucre, oignon grillé en poudre, sel, ail en poudre, arôme naturel de laurier, arôme naturel de muscade.', 'https://static.openfoodfacts.org/images/products/356/470/000/9925/front_fr.5.400.jpg', '4.5', '1.6', '8.3', '1.6', '3.3', '7.3', '0.75', '0.295275590551181', '', '1');

