VALUES ('3564700009956', 'Saucisses aux lentilles', 'Sauce : eau, concentré de tomates, arômes (dont _gluten_), amidon modifié de maïs, poudre d\'oignon grillé, arôme naturel de poivre, sucre, arôme naturel d\'ail. Légumes : lentilles réhydratées (30 %), carottes (2,5 %), petits oignons (0,5 %) (oignons, eau, sel). Saucisses pur porc fumées (20 %) : viande de porc, maigre de tête de porc, eau, gras et couenne de porc, plasma de porc, sel, arôme naturel de poivre, stabilisant : E451, épice, gélifiants : gomme guar, gomme xanthane, carraghénanes, aromate, sucre, sirop de glucose déshydraté, arôme naturel d\'ail, arôme naturel de muscade, conservateur : E250.', 'https://static.openfoodfacts.org/images/products/356/470/000/9956/front_fr.3.400.jpg', '4.5', '1.7', '7.9', '1.5', '2.2', '6.9', '0.9', '0.354330708661417', '', '1');

