VALUES ('3564700009970', 'Petit salé aux lentilles ', 'Lentilles réhydratées 34%, eau, viande de porc traitée en salaison et précuite 24% (viande de porc, eau, sel, stabilisant : E451, gélifiant, E407a, conservateur : E250) carottes 2,3%, graisse de canard 2%, oignons grelots 0,7%, concentré de tomates, plantes aromatiques, sel, amidon modifié de maïs, arôme naturel de thym, arôme naturel de laurier.', 'https://static.openfoodfacts.org/images/products/356/470/000/9970/front_fr.3.400.jpg', '3.4', '1', '8.69', '0.5', '2.6', '9.31', '0.8', '0.315', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564700009987', 'Choucroute Garnie Au Vin Blanc - 800 g', 'Choucroute 46 %, eau, saucisses fumées et rondelles de saucisson fumé 16 % (viande de porc ; maigre de tête de porc ; eau ; gras et couenne de porc ; plasma de porc ; protéines de _blé_ ; sel ; amidon de pois ; stabilisant : E451 ; arôme naturel de poivre ; gélifiants : gomme guar, gomme xanthane, carraghénanes, sirop de glucose déshydraté ; coriandre en poudre ; colorant : extrait de paprika ; antioxydant : acide ascorbique ; arôme naturel d\'ail ; arôme naturel de muscade ; conservateur : E250), viande de porc traitée en salaison précuite 6,5 % (viande de porc, eau, sel, stabilisant : E451, gélifiant : E407a, conservateur : E250), pommes de terre 5 % (dont antioxydant : acide ascorbique, conservateur : disulfite de sodium), saindoux 2 %, vin blanc 1 % (dont conservateur : disulfite de sodium), sel, antioxydant : acide ascorbique, arôme naturel de poivre, baies de genièvre et grains de poivre.', 'https://static.openfoodfacts.org/images/products/356/470/000/9987/front_fr.28.400.jpg', '7.4', '2.7', '2.4', '0.2', '1.8', '4.1', '1.5', '0.590551181102362', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
